import React from 'react';
import { GridList, GridListTile } from '@material-ui/core';

const ImageGallary = () =>{
    return(
        <div>
            <GridList>
                {props.photos.map(img =>(
                    <GridListTile>
                        <img src={img.urls.regular} alt={img.alt_description}/>
                    </GridListTile>
                ))}
            </GridList>
        </div>
    )
};

export default ImageGallary;
